from flask import Flask, render_template, jsonify, send_file
from jinja2 import ChoiceLoader, FileSystemLoader
import json, os, io
from reportlab.lib.pagesizes import A4
from reportlab.lib.styles import getSampleStyleSheet
from reportlab.platypus import SimpleDocTemplate, Paragraph, Spacer, ListFlowable, ListItem




# api/index.py (must export `app`)
from flask import Flask

app = Flask(__name__)

@app.get("/")
def root():
    # return "Flask serverless function on Vercel"




    app = Flask(__name__, template_folder='templates', static_folder='static')
    # Load templates from both /templates and project root (for index.html at root)
    app.jinja_loader = ChoiceLoader([
        FileSystemLoader(os.path.join(os.path.dirname(__file__), 'templates')),
        FileSystemLoader(os.path.dirname(__file__))
    ])

    PHOTO_DATA = "data:image/png;base64,"

    with open(os.path.join(os.path.dirname(__file__), 'resume.json'), 'r', encoding='utf-8') as f:
        RESUME = json.load(f)

    @app.route('/')
    def index():
        return render_template('index.html', r=RESUME, photo_data=PHOTO_DATA)

    @app.route('/api/resume')
    def api_resume():
        return jsonify(RESUME)

    @app.route('/download-pdf')
    def download_pdf():
        buf = io.BytesIO()
        doc = SimpleDocTemplate(buf, pagesize=A4)
        styles = getSampleStyleSheet()
        story = []

        title = RESUME.get('name','') + '  Resume'
        story.append(Paragraph(title, styles['Title']))
        story.append(Spacer(1, 12))
        story.append(Paragraph(RESUME.get('objective',''), styles['BodyText']))
        story.append(Spacer(1, 12))

        contact = RESUME.get('contact', {})
        contact_lines = [contact.get('email',''), contact.get('phone',''), contact.get('address',''), contact.get('linkedin','')]
        story.append(Paragraph('<b>Contact</b>', styles['Heading3']))
        for line in contact_lines:
            if line:
                story.append(Paragraph(line, styles['BodyText']))
        story.append(Spacer(1, 8))

        story.append(Paragraph('<b>Experience</b>', styles['Heading3']))
        for exp in RESUME.get('experience', []):
            story.append(Paragraph('<b>'+exp.get('title','')+'</b>  '+exp.get('company','')+' ('+exp.get('period','')+')', styles['BodyText']))
            items = [ListItem(Paragraph(h, styles['BodyText'])) for h in exp.get('highlights', [])]
            if items:
                story.append(ListFlowable(items, bulletType='bullet'))
            story.append(Spacer(1, 6))

        story.append(Paragraph('<b>Projects</b>', styles['Heading3']))
        for p in RESUME.get('projects', []):
            story.append(Paragraph('<b>'+p.get('name','')+'</b>', styles['BodyText']))
            story.append(Paragraph(p.get('description',''), styles['BodyText']))
            story.append(Spacer(1, 6))

        story.append(Paragraph('<b>Education</b>', styles['Heading3']))
        for e in RESUME.get('education', []):
            story.append(Paragraph(e.get('course','')+'  '+e.get('institution','')+' ('+e.get('year','')+')  '+e.get('marks',''), styles['BodyText']))
        story.append(Spacer(1, 6))

        story.append(Paragraph('<b>Skills</b>', styles['Heading3']))
        for group, vals in RESUME.get('skills', {}).items():
            story.append(Paragraph('<b>'+group.title()+':</b> '+', '.join(vals), styles['BodyText']))

        doc.build(story)
        buf.seek(0)
        dn = RESUME.get('name','resume').replace(' ', '_')+'_resume.pdf'
        return send_file(buf, mimetype='application/pdf', as_attachment=True, download_name=dn)

    if __name__ == '__main__':
        app.run(debug=True)
